import { InternationalizationComponent } from './internationalization.component';


import { HttpModule, JsonpModule } from '@angular/http';
import { BrowserModule } from '@angular/platform-browser';
import 'rxjs/add/operator/map';
import { NgModule, ModuleWithProviders, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';


import { CalendarModule } from '@syncfusion/ej2-ng-calendars';






import { SharedModule } from './common/shared.module';




@NgModule({
    imports: [CalendarModule, SharedModule, HttpModule, JsonpModule, BrowserModule],
declarations: [InternationalizationComponent],
bootstrap: [InternationalizationComponent]
})
export class AppModule { }

internationalization.component:
import * as n3 from './common/cldr-data/main/de/timeZoneNames.json';
import * as n2 from './common/cldr-data/main/de/numbers.json';
import * as n1 from './common/cldr-data/main/de/ca-gregorian.json';
import * as n0 from './common/cldr-data/supplemental/numberingSystems.json';
import { Component, ViewEncapsulation, Inject } from '@angular/core';
import { loadCldr, L10n } from '@syncfusion/ej2-base';

@Component({
    selector: 'control-content',
    templateUrl: 'internationalization.html',
    styleUrls: ['calendar-style.css'],
    encapsulation: ViewEncapsulation.None
})
export class InternationalizationComponent {
    public date: Object = new Date();
    locale: string = 'de';
    ngOnInit(): void {
        loadCldr(
            n0,
            n1,
            n2,
            n3
        );
    }
    changeLocale() {
        let culture: string = (document.getElementById('cultures') as HTMLSelectElement).value;
        this.locale = culture;
    }

    onValueChange(args: any): void {
        (<HTMLInputElement>document.getElementById('selected')).textContent = 'Selected Value: ' + args.value.toLocaleDateString();
    }
}

